'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term1' => '&amp;vendorShortName; ਸਰਵਿਸ ਨੂੰ ਆਪਣੀ ਲੋੜ ਮੁਤਾਬਕ ਬੰਦ ਜਾਂ ਬਦਲ ਸਕਦਾ ਹੈ।',
'mail/chrome/messenger/preferences/applications.dtd:authRequired.button.accesskey' => 'U',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term3' => 'ਸਰਵਿਸਾਂ ਨੂੰ &#34;ਜਿਵੇਂ ਹਨ&#34; ਦੇ ਅਧਾਰ ਉੱਤੇ ਹੀ ਉਪਲੱਬਧ ਕਰਵਾਇਆ ਜਾਂਦਾ ਹੈ।  &amp;vendorShortName;, ਇਸ ਦੇ ਯੋਗਦਾਨੀ, ਲਾਈਸੈਂਸ ਰੱਖਣ ਵਾਲੇ ਅਤੇ ਵੰਡਣ ਵਾਲੇ ਸਭ ਵਾਰੰਟੀਆਂ ਤੋਂ ਇਨਕਾਰੀ ਹਨ, ਭਾਵੇਂ ਦੱਸਿਆ ਗਿਆ ਹੋਵੇ ਜਾਂ ਸਮਝਿਆ ਗਿਆ, ਕਮੀਆਂ, ਵਾਰੰਟੀਆਂ, ਬਿਨਾਂ, ਜਿਸ ਨਾਲ ਸਰਵਿਸਾਂ ਵਰਤੋਂ ਯੋਗ ਅਤੇ ਤੁਹਾਡੇ ਖਾਸ ਮਕਸਦ ਲਈ ਫਿੱਟ ਹੋਣ ਲਈ ਹੈ, ਸਮੇਤ। ਤੁਸੀਂ ਸਰਵਿਸਾਂ ਨੂੰ ਆਪਣੇ ਮਕਸਦ ਲਈ ਵਰਤੋਂ ਕਰਨ ਵਾਸਤੇ ਖੁਦ ਹੀ ਪੂਰੀ ਤਰ੍ਹਾਂ ਜ਼ਿੰਮੇਵਾਰ ਹੋ, ਅਤੇ ਸਰਵਿਸਾਂ ਦੀ ਕੁਆਲਟੀ ਅਤੇ ਕਾਰਗੁਜ਼ਾਰੀ ਲਈ ਵੀ। ਕੁਝ ਕਾਨੂੰਨੀ ਦਾਅ-ਪੇਚ ਲਾਗੂ ਕੀਤੀਆਂ ਵਾਰੰਟੀਆਂ ਨੂੰ ਛੱਡਣ ਜਾਂ ਸੀਮਿਤ ਕਰਨ ਦੀ ਇਜ਼ਾਜ਼ਤ ਨਹੀਂ ਦਿੰਦੇ, ਇਸਕਰਕੇ ਇਹ ਦਾਅਵਾ ਤੁਹਾਡੇ ਉੱਤੇ ਲਾਗੂ ਨਹੀਂ ਵੀ ਹੋ ਸਕਦਾ ਹੈ।',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term2' => '&amp;brandShortName; ਦੇ ਨਾਲ ਦਿੱਤੇ ਇੰਨ੍ਹਾਂ ਸਰਵਿਸਾਂ ਦੀ ਵਰਤੋਂ ਕਰਨ ਲਈ ਤੁਹਾਨੂੰ ਜੀ ਆਇਆਂ ਨੂੰ ਅਤੇ ਤੁਹਾਨੂੰ ਇਹ ਕਰਨ ਲਈ ਸਭ ਲੋੜੀਦੇ ਅਧਿਕਾਰ ਹਨ। &amp;vendorShortName; ਅਤੇ ਇਸ ਦੇ ਲਾਈਸੈਂਸ ਰੱਖਣ ਵਾਲੇ ਸਰਵਿਸਾਂ ਵਿੱਚ ਬਾਕੀ ਸਭ ਅਧਿਕਾਰ ਰਾਖਵੇਂ ਰੱਖਦੇ ਹਨ। ਇਨ੍ਹਾਂ ਸ਼ਰਤਾਂ ਦਾ ਮਕਸਦ ਕਦੇ ਵੀ &amp;brandShortName; ਅਤੇ &amp;brandShortName; ਦੇ ਸਬੰਧਿਤ ਸਰੋਤ ਕੋਡ ਵਰਜਨ ਲਈ ਲਾਗੂ ਓਪਨ ਸੋਰਸ ਲਾਈਸੈਂਸ ਵਿੱਚ ਦਿੱਤੇ ਅਧਿਕਾਰਾਂ ਨੂੰ ਸੀਮਿਤ ਕਰਨਾ ਨਹੀਂ ਹੈ।',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term5' => '&amp;vendorShortName; ਲੋੜ ਪੈਣ ਉੱਤੇ ਸਮੇਂ ਸਮੇਂ ਇਹ ਸ਼ਰਤਾਂ ਨੂੰ ਅੱਪਡੇਟ ਵੀ ਕਰ ਸਕਦਾ ਹੈ। ਇਹ ਸ਼ਰਤਾਂ ਨੂੰ &amp;vendorShortName; ਦੇ ਲਿਖਤੀ ਇਕਰਾਰਨਾਮੇ ਬਿਨਾਂ ਬਦਲਿਆ ਜਾਂ ਰੱਦ ਨਹੀਂ ਕੀਤਾ ਜਾ ਸਕਦਾ ਹੈ।',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term4' => 'ਕਿਉਂਕਿ ਕਾਨੂੰਨ ਵਲੋਂ ਕੁਝ ਛੋਟ ਚਾਹੀਦੀ ਹੈ, ਇਸਕਰਕੇ &amp;vendorShortName;, ਇਸ ਦੇ ਯੋਗਦਾਨੀ, ਲਾਈਸੈਂਸ ਰੱਖਣ ਵਾਲੇ ਅਤੇ ਵੰਡਣ ਵਾਲੇ (ਡਿਸਟਰੀਬਿਊਟਰ) ਕਿਸੇ ਵੀ ਅਸਿੱਧੇ, ਖਾਸ, ਘਟਨਾਕ੍ਰਮ, ਪਰਮਾਣਯੋਗ, ਦੰਡ ਦੇਣ ਯੋਗ ਜਾਂ ਨਕਲ ਯੋਗ ਨੁਕਸਾਨ &amp;brandShortName; ਅਤੇ ਇਸ ਦੀਆਂ ਸਰਵਿਸਾਂ ਨਾਲ ਹੋਵੇ ਜਾਂ ਇਸ ਦੀ ਵਰਤੋਂ ਨਾਲ ਸਬੰਧਿਤ ਕਿਵੇਂ ਵੀ ਹੋਵੇ, ਲਈ ਜ਼ਿੰਮੇਵਾਰ ਨਹੀਂ ਹੋਣਗੇ।  ਇਹਨਾਂ ਸ਼ਰਤਾਂ ਅਧੀਨ ਵੱਧ ਤੋਂ ਵੱਧ ਪੂਰੀ ਜ਼ਿੰਮੇਵਾਰੀ $500 (ਪੰਜ ਸੌ ਡਾਲਰ) ਤੋਂ ਵੱਧ ਨਹੀਂ ਸਕਦੀ ਹੈ। ਕੁਝ ਕਾਨੂੰਨੀ ਦਾਅ-ਪੇਚ ਲਾਗੂ ਕੀਤੀਆਂ ਵਾਰੰਟੀਆਂ ਨੂੰ ਛੱਡਣ ਜਾਂ ਸੀਮਿਤ ਕਰਨ ਦੀ ਇਜ਼ਾਜ਼ਤ ਨਹੀਂ ਦਿੰਦੇ, ਇਸਕਰਕੇ ਇਹ ਬੰਦਸ਼ ਅਤੇ ਪਾਬੰਦੀ ਤੁਹਾਡੇ ਉੱਤੇ ਲਾਗੂ ਨਹੀਂ ਵੀ ਹੋ ਸਕਦੀ ਹੈ।',
