'toolkit/chrome/mozapps/extensions/extensions.dtd:warning.checkcompatibility.enable.label' => 'ਚਾਲੂ',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term7' => 'ਇਹ ਸ਼ਰਤਾਂ ਅਮਰੀਕਾ ਦੇ ਕੈਲੇਫੋਰਨੀਆ ਸੂਬੇ ਦੇ ਕਾਨੂੰਨ ਦੀ ਪਾਲਨਾ ਕਰਦੀਆਂ ਹਨ। ਜੇ ਇਨ੍ਹਾਂ ਸ਼ਰਤਾਂ ਦਾ ਕੋਈ ਵੀ ਭਾਗ ਅਵੈਧ ਹੋਵੇ ਜਾਂ ਲਾਗੂ ਨਾ ਕਰਨ ਯੋਗ ਹੋਵੇ ਤਾਂ, ਬਾਕੀ ਭਾਗ ਪੂਰੀ ਤਰ੍ਹਾਂ ਲਾਗੂ ਅਤੇ ਪਰਭਾਵੀ ਹੋਵੇਗਾ। ਇਨ੍ਹਾਂ ਸ਼ਰਤਾਂ ਦੇ ਇੱਕ ਅਨੁਵਾਦ ਕੀਤੇ ਵਰਜਨ ਅਤੇ ਅੰਗਰੇਜ਼ੀ ਵਰਜਨ ਵਿੱਚ ਕੋਈ ਵੀ ਅੰਤਰ ਜਾਂ ਅਪਵਾਦ ਹੋਵੇ ਤਾਂ ਅੰਗਰੇਜ਼ੀ ਵਰਜਨ ਮੰਨਣਯੋਗ ਹੋਵੇਗਾ।',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term4' => 'ਸਰਵਿਸਾਂ ਨੂੰ &#34;ਜਿਵੇਂ ਹਨ&#34; ਦੇ ਅਧਾਰ ਉੱਤੇ ਹੀ ਉਪਲੱਬਧ ਕਰਵਾਇਆ ਜਾਂਦਾ ਹੈ।  &amp;vendorShortName;, ਇਸ ਦੇ ਯੋਗਦਾਨੀ, ਲਸੰਸ ਰੱਖਣ ਵਾਲੇ ਅਤੇ ਵੰਡਣ ਵਾਲੇ ਸਭ ਵਾਰੰਟੀਆਂ ਤੋਂ ਇਨਕਾਰੀ ਹਨ, ਭਾਵੇਂ ਦੱਸਿਆ ਗਿਆ ਹੋਵੇ ਜਾਂ ਸਮਝਿਆ ਗਿਆ, ਕਮੀਆਂ, ਵਾਰੰਟੀਆਂ, ਬਿਨਾਂ, ਜਿਸ ਨਾਲ ਸਰਵਿਸਾਂ ਵਰਤੋਂ ਯੋਗ ਅਤੇ ਤੁਹਾਡੇ ਖਾਸ ਮਕਸਦ ਲਈ ਫਿੱਟ ਹੋਣ ਲਈ ਹੈ, ਸਮੇਤ। ਤੁਸੀਂ ਸਰਵਿਸਾਂ ਨੂੰ ਆਪਣੇ ਮਕਸਦ ਲਈ ਵਰਤੋਂ ਕਰਨ ਵਾਸਤੇ ਖੁਦ ਹੀ ਪੂਰੀ ਤਰ੍ਹਾਂ ਜ਼ਿੰਮੇਵਾਰ ਹੋ, ਅਤੇ ਸਰਵਿਸਾਂ ਦੀ ਕੁਆਲਟੀ ਅਤੇ ਕਾਰਗੁਜ਼ਾਰੀ ਲਈ ਵੀ। ਕੁਝ ਕਾਨੂੰਨੀ ਦਾਅ-ਪੇਚ ਲਾਗੂ ਕੀਤੀਆਂ ਵਾਰੰਟੀਆਂ ਨੂੰ ਛੱਡਣ ਜਾਂ ਸੀਮਿਤ ਕਰਨ ਦੀ ਇਜ਼ਾਜ਼ਤ ਨਹੀਂ ਦਿੰਦੇ, ਇਸਕਰਕੇ ਇਹ ਦਾਅਵਾ ਤੁਹਾਡੇ ਉੱਤੇ ਲਾਗੂ ਨਹੀਂ ਵੀ ਹੋ ਸਕਦਾ ਹੈ।',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term5' => 'ਕਿਉਂਕਿ ਕਾਨੂੰਨ ਵਲੋਂ ਕੁਝ ਛੋਟ ਚਾਹੀਦੀ ਹੈ, ਇਸਕਰਕੇ &amp;vendorShortName;, ਇਸ ਦੇ ਯੋਗਦਾਨੀ, ਲਸੰਸ ਰੱਖਣ ਵਾਲੇ ਅਤੇ ਵੰਡਣ ਵਾਲੇ (ਡਿਸਟਰੀਬਿਊਟਰ) ਕਿਸੇ ਵੀ ਅਸਿੱਧੇ, ਖਾਸ, ਘਟਨਾਕ੍ਰਮ, ਪਰਮਾਣਯੋਗ, ਦੰਡ ਦੇਣ ਯੋਗ ਜਾਂ ਨਕਲ ਯੋਗ ਨੁਕਸਾਨ &amp;brandShortName; ਅਤੇ ਇਸ ਦੀਆਂ ਸਰਵਿਸਾਂ ਨਾਲ ਹੋਵੇ ਜਾਂ ਇਸ ਦੀ ਵਰਤੋਂ ਨਾਲ ਸਬੰਧਿਤ ਕਿਵੇਂ ਵੀ ਹੋਵੇ, ਲਈ ਜ਼ਿੰਮੇਵਾਰ ਨਹੀਂ ਹੋਣਗੇ।  ਇਹਨਾਂ ਸ਼ਰਤਾਂ ਅਧੀਨ ਵੱਧ ਤੋਂ ਵੱਧ ਪੂਰੀ ਜ਼ਿੰਮੇਵਾਰੀ $500 (ਪੰਜ ਸੌ ਡਾਲਰ) ਤੋਂ ਵੱਧ ਨਹੀਂ ਸਕਦੀ ਹੈ। ਕੁਝ ਕਾਨੂੰਨੀ ਦਾਅ-ਪੇਚ ਲਾਗੂ ਕੀਤੀਆਂ ਵਾਰੰਟੀਆਂ ਨੂੰ ਛੱਡਣ ਜਾਂ ਸੀਮਿਤ ਕਰਨ ਦੀ ਇਜ਼ਾਜ਼ਤ ਨਹੀਂ ਦਿੰਦੇ, ਇਸਕਰਕੇ ਇਹ ਬੰਦਸ਼ ਅਤੇ ਪਾਬੰਦੀ ਤੁਹਾਡੇ ਉੱਤੇ ਲਾਗੂ ਨਹੀਂ ਵੀ ਹੋ ਸਕਦੀ ਹੈ।',
